import React, { Component } from 'react';

export default class Company extends Component {

    render(){

        return (

            <div className='company-container flex-container-col'>
                <h1 className="name flex-item-col"> 
                   Hood Food Guide

                </h1>
                <h1 className="home-headline h1 flex-item-col">
                   See where chefs and restaurant owners love to eat in every neighbourhood.

                </h1>
                <div className="home-text-block flex-item-col">
                   Discover better restaurants faster with Hood Food Guide.
                </div>
                <div className="flex-item-col">
                    <img src="./images/180ae7a0bcf7.png" width="144" height="43" alt="app" className="app-store"/>
                    <img src="./images/e9cd846dc748.png" width="144" height="43" alt="play" className="play-store"/>
                </div>
            </div>
        );
    }
}
